import React, { Component } from 'react';
import {
    Content,
    ContentLeft,
    ContentRight,
    ContentTitle,
    ContentContent,
    ContentBotton
} from './style'
class LeftContent extends Component{
    render () {
        return (
            <Content>
                <ContentLeft>
                    <ContentTitle></ContentTitle>
                    <ContentContent></ContentContent>
                    <ContentBotton></ContentBotton>
                </ContentLeft>
                <ContentRight>
                    <img/>
                </ContentRight>
            </Content>
        )
    }
}
export default LeftContent;
